import React, { useState, useEffect } from 'react';
import {
  Button,
  Alert,
  Chip,
  Box,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';
import DateRangeFilter from '../../components/Common/DateRangeFilter';
import AddIcon from '@mui/icons-material/Add';
import { useNavigate } from 'react-router-dom';
import Layout from '../../components/Layout/Layout';
import PageHeader from '../../components/Common/PageHeader';
import DataTable from '../../components/Common/DataTable';
import LoadingSpinner from '../../components/Common/LoadingSpinner';
import vendaService from '../../services/vendaService';
import { formatCurrency, formatDateTime } from '../../utils/formatters';

const VendasList = () => {
  const [vendas, setVendas] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [searchTerm, setSearchTerm] = useState('');
  const [statusFilter, setStatusFilter] = useState('');
  const [fromDate, setFromDate] = useState('');
  const [toDate, setToDate] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    loadVendas();
  }, []);

  const loadVendas = async (params = {}) => {
    setLoading(true);
    try {
      const data = await vendaService.listarTodas(params);
      const list = Array.isArray(data) ? data : [];
      setVendas(list);
    } catch (err) {
      setError('Erro ao carregar vendas');
      setVendas([]);
    } finally {
      setLoading(false);
    }
  };


  // client applied filters will call server-side endpoint with params
  const applyFilters = () => {
    const params = {};
    if (searchTerm) params.search = searchTerm;
    if (statusFilter) params.status = statusFilter;
    if (fromDate) params.fromDate = fromDate;
    if (toDate) params.toDate = toDate;
    loadVendas(params);
  };

  const columns = [
    { field: 'numeroVenda', headerName: 'Número' },
    {
      field: 'dataVenda',
      headerName: 'Data',
      render: (value) => formatDateTime(value),
    },
    { field: 'clienteNome', headerName: 'Cliente' },
    {
      field: 'total',
      headerName: 'Total',
      render: (value) => formatCurrency(value),
      align: 'right',
    },
    { field: 'formaPagamento', headerName: 'Forma de Pagamento' },
    {
      field: 'status',
      headerName: 'Status',
      render: (value) => (
        <Chip
          label={value}
          color={value === 'CONCLUIDA' ? 'success' : 'default'}
          size="small"
        />
      ),
    },
  ];

  if (loading)
    return (
      <Layout>
        <LoadingSpinner />
      </Layout>
    );

  return (
    <Layout>
      <PageHeader
        title="Vendas"
        subtitle="Histórico de vendas realizadas"
        actions={<Button variant="contained" startIcon={<AddIcon />} onClick={() => navigate('/vendas/nova')}>Nova Venda</Button>}
      />

      {error && (
        <Alert severity="error" onClose={() => setError('')} sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      {/* Filters bar */}
      <Box sx={{ mb: 2, display: 'flex', gap: 2, flexWrap: 'wrap', alignItems: 'center' }}>
        <DateRangeFilter
          from={fromDate}
          to={toDate}
          onChangeFrom={setFromDate}
          onChangeTo={setToDate}
          onApply={() => { /* apply is reactive via state */ }}
          onClear={() => { setFromDate(''); setToDate(''); }}
        />

        <TextField
          size="small"
          label="Buscar (cliente ou número)"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />

        <FormControl size="small" sx={{ minWidth: 180 }}>
          <InputLabel>Status</InputLabel>
          <Select
            value={statusFilter}
            label="Status"
            onChange={(e) => setStatusFilter(e.target.value)}
          >
            <MenuItem value="">Todos</MenuItem>
            {/* keep example statuses common in backend */}
            <MenuItem value="CONCLUIDA">Concluída</MenuItem>
            <MenuItem value="PENDENTE">Pendente</MenuItem>
            <MenuItem value="CANCELADA">Cancelada</MenuItem>
          </Select>
        </FormControl>

        <Button variant="contained" size="small" onClick={applyFilters}>Aplicar</Button>
        <Button variant="outlined" size="small" onClick={() => { setSearchTerm(''); setStatusFilter(''); setFromDate(''); setToDate(''); }}>Limpar</Button>
      </Box>

      <DataTable columns={columns} data={vendas} actions={false} />
    </Layout>
  );
};

export default VendasList;
